import React from "react";
import styles from "./App.module.css";
import { Container, Header } from "semantic-ui-react";

function App() {
  return (
    <Container>
      <Header size="large">
        <div className={styles.title}>SimFace</div>
      </Header>
    </Container>
  );
}

export default App;
